INSERT INTO stock (branch_id, product_barcode_id, store_stock, last_entry) VALUES ( 1, (SELECT product_barcodes.id FROM product_barcodes INNER JOIN 	product_details ON product_barcodes.product_detail_id = product_details.id INNER JOIN 	products ON product_details.product_id = products.id 	WHERE products.code = 'WFFSKRC2WNR' AND product_barcodes.size_id = (SELECT size.id FROM size WHERE size.description = '5')), 20, NOW()::TIMESTAMP WITHOUT TIME ZONE );
